syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";

import "ParentQuest.proto";

message FinishedParentQuestNotify {
	enum CmdId {
		option allow_alias = true;
		NONE = 0;
		ENET_CHANNEL_ID = 0;
		ENET_IS_RELIABLE = 1;
		CMD_ID = 437;
	}

	repeated ParentQuest parent_quest_list = 12;
}
